import React from 'react';
import './Navbar.css';
import logo from '../../assets/LOGO.png'; 

const NavBar = () => {
  return (
    <nav className="navbar">
      <div className="navbar-logo">
        <img src={logo} alt="Logo" />
        <span className="navbar-name">Voyaige</span>
      </div>
    </nav>
  );
};

export default NavBar;
